import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the featured products grid to appear (using ID selector)
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Find the first product card using a CSS selector
    const productCard = await page.$('#productsGrid .product-card');
    if (!productCard) throw new Error('No product card found in featured products');

    // Click the first product card to open the product detail modal
    await productCard.click();

    // Wait for the product detail modal to appear (using ID selector)
    await page.waitForSelector('#productModal', { timeout: 5000 });

    // Take screenshot of the product detail modal
    const step2 = path.join(screenshotsDir, 'step_2_product_modal.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the "Add to Wish List" button (using button text content)
    const addToWishlistBtn = await page.waitForSelector(
      "//button[contains(normalize-space(), 'Add to Wish List')]",
      { timeout: 5000, strict: false }
    );

    // Click the "Add to Wish List" button
    await addToWishlistBtn.click();

    // Wait for the notification to appear (using notification class)
    const notification = await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to wishlist
    const step3 = path.join(screenshotsDir, 'step_3_added_to_wishlist.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Close the product modal (using close button with class "close")
    const closeBtn = await page.waitForSelector('#productModal .close', { timeout: 5000 });
    await closeBtn.click();

    // Go to the wishlist page (find "Your Wish List" link and click)
    // Use a unique XPath to the first visible "Your Wish List" link
    const wishListLink = await page.waitForSelector(
      "//a[normalize-space()='Your Wish List']",
      { timeout: 5000 }
    );
    await wishListLink.click();

    // Wait for the wishlist page to load (using heading selector)
    await page.waitForSelector('.wishlist-page h2', { timeout: 5000 });

    // Take screenshot of the wishlist page
    const step4 = path.join(screenshotsDir, 'step_4_wishlist_page.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract the title of the first wishlist item for verification
    const wishlistTitleEl = await page.$('.wishlist-item .wishlist-title');
    const wishlistTitle = wishlistTitleEl ? await wishlistTitleEl.textContent() : null;

    return {
      success: true,
      action: "Added the first product to the wishlist and verified its presence in the wishlist page.",
      extractedData: {
        wishlistFirstItemTitle: wishlistTitle ? wishlistTitle.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
